window.bookSummaryJSON = "<p>In a world where food is thin and magic is dying out, one farmer gains enough magic to water his crops.</p> <p>Jealousy spreads throughout his community. Even giving away all his crops is not enough. His only chance at safety is to reduce his own rarity. He must rebuild magic and make it common again.</p> <p>But he soon discovers something more ancient lurks below the surface, ready to feast.</p>"; 
